import React, { useEffect, useState } from 'react';

const KeywordRecom = () => {
  return (
    <div>
      <div className="keyword_list_sex">
        <button className="keyword_button"> 남자 </button>
        <button className="keyword_button"> 여자 </button>
      </div>
      <div className="keyword_list_age">
        <button className="keyword_button"> 10대 </button>
        <button className="keyword_button"> 20대 </button>
        <button className="keyword_button"> 30대 </button>
        <button className="keyword_button"> 40대 </button>
      </div>
    </div>
  );
}

export default KeywordRecom;
